import styled from "styled-components";
import { Link } from "react-router-dom";

const Main = () => {

    useEffect(
        axios.get(`${BASE_URL}/posts/lists`,)
    ),[]

return (
    <center>
            <ListH1>게시물 목록</ListH1>
        <TableWrapper>
            <table className="table">
                <tr>
                    <th>NO</th>
